<!DOCTYPE html>
<html lang="zh">
<head>

    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="Content-Security-Policy" content="upgrade-insecure-requests" />
    <title>JavHTML</title>
    <link rel="shortcut icon" href="images/precomposed.png" type="image/x-icon">
    <link rel="stylesheet" href="http://cdn.bootcss.com/bootstrap/3.3.7/css/bootstrap.min.css" >
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css" integrity="sha512-SfTiTlX6kk+qitfevl/7LibUOeJWlt9rbyDn92a1DqWOw9vWG2MFoays0sgObmWazO5BQPiFucnnEAjpAB+/Sw==" crossorigin="anonymous" referrerpolicy="no-referrer" />
    <script src="https://code.jquery.com/jquery-3.7.1.min.js"></script>
    <link rel="stylesheet" href="./css/styles.css">
    <link rel="stylesheet" href="./css/mainsearch.css">
    <link rel="stylesheet" href="./css/pagination.css">
    <link rel="stylesheet" href="./css/videopanel.css">
    <script src="./js/system.js"></script>
    <script src="./js/pagination.js"></script>
    <script src="./js/alphadata.js"></script>
    <script src="./js/videopanel.js"></script>
    <script src="./js/videoplus.js"></script>
</head>
<body>
    <script src="./js/canvas-nest.js" type="text/javascript" color="208,208,208" opacity="0.7" count="120" ></script>
    <div class="javtopnomal" id="javtopnomalid"></div>
    <div class="htmllogo" id="htmllogoid">
        <img class="htmllogoimg" id="htmllogoimgid" src="images/logotop.png" alt="">
    </div>
    <div class="mainsearch" id="mainsearchid">
        <form>
            <input type="text" id="mainsearchinputid" placeholder="请输入您要搜索的内容...">
            <button type="submit" id="mainsearchbtnid" onclick="return false"></button>
        </form>
    </div>
    <div class="remind" id="remindid">
        <div class="remindimg" id="remindimgid">
            <!-- remind图标 -->
        </div>
        <div class="remindstr" id="remindstrid">
            <!-- 找到关于NA的NA条相关信息 -->
        </div>
    </div>
    <div class="javframe" id="javframeid"></div>
    <div class="framepagesbox" id="framepagesboxid">
        <div class="framepages" id="pages"></div>
    </div>
    <div class="copyright" id="copyrightid">
        <b class="copyrightstr" id="copyrightstrid">Copyright © 1998 - 2028 JAVHTML Corporation, All Rights Reserved</b>
    </div>
    <div class="testlog" id="testlogid">
        <li id="testlogid1"></li>
        <p id="testlogid2"></p>
        <p id="testlogid3"></p>
    </div>

</html>
<script>mainsearchinputid.focus();</script>
